import React, { useState } from 'react';
import { Link } from 'react-router-dom';

function Terms() {
  const [checkedItems, setCheckedItems] = useState({
    all: false,
    age: false,
    term: false,
    requiredPrivacy: false,
    marketingPrivacy: false,
    advertising: false,
  });

  const handleChange = (event) => {
    const { name, checked } = event.target;
    setCheckedItems((prevItems) => ({
      ...prevItems,
      [name]: checked,
    }));

    if (name === 'all') {
      setCheckedItems({
        all: checked,
        age: checked,
        term: checked,
        requiredPrivacy: checked,
        marketingPrivacy: checked,
        advertising: checked,
      });
    } else {
      setCheckedItems((prevItems) => {
        const updatedItems = { ...prevItems, [name]: checked };
        const allChecked = updatedItems.age && updatedItems.term && updatedItems.requiredPrivacy && updatedItems.marketingPrivacy && updatedItems.advertising;
        return { ...updatedItems, all: allChecked };
      });
    }
  };

  const isAllRequiredChecked = checkedItems.age && checkedItems.term && checkedItems.requiredPrivacy;

  return (
    <div className="form-container">
      <h3>29CM 서비스 이용약관에<br />동의해주세요.</h3>
      <div className="checkbox-container">
        <input
          className="checkbox"
          name="all"
          type="checkbox"
          checked={checkedItems.all}
          onChange={handleChange}
        />
        <label htmlFor="all">모두 동의 (선택 정보 포함)</label>
      </div>
      <ul>
        <li>
          <input
            className="checkbox"
            name="age"
            type="checkbox"
            checked={checkedItems.age}
            onChange={handleChange}
          />
          <label htmlFor="age">[필수] 만 14세 이상입니다</label>
        </li>
        <li>
          <input
            className="checkbox"
            name="term"
            type="checkbox"
            checked={checkedItems.term}
            onChange={handleChange}
          />
          <label htmlFor="term">[필수] 이용약관 동의</label>
          <button type="button">보기</button>
        </li>
        <li>
          <input
            className="checkbox"
            name="requiredPrivacy"
            type="checkbox"
            checked={checkedItems.requiredPrivacy}
            onChange={handleChange}
          />
          <label htmlFor="requiredPrivacy">[필수] 개인정보 수집 및 이용 동의</label>
          <button type="button">보기</button>
        </li>
        <li>
          <input
            className="checkbox"
            name="marketingPrivacy"
            type="checkbox"
            checked={checkedItems.marketingPrivacy}
            onChange={handleChange}
          />
          <label htmlFor="marketingPrivacy">[선택] 마케팅 목적의 개인정보 수집 및 이용 동의</label>
          <button type="button">보기</button>
        </li>
        <li>
          <input
            className="checkbox"
            name="advertising"
            type="checkbox"
            checked={checkedItems.advertising}
            onChange={handleChange}
          />
          <label htmlFor="advertising">[선택] 광고성 정보 수신 동의</label>
        </li>
      </ul>
      <Link to="/signup">
        <button type="button" disabled={!isAllRequiredChecked}>동의하고 가입하기</button>
      </Link>
    </div>
  );
}

export default Terms;
